import styled from "styled-components";

const LikeStyled = styled.button`
  border: none;
  background-color: transparent;
  font-size: 1.4em;
  transition: 300ms
  &:hover {
    color: red;
    transition: 500ms;
  }
`;

export default LikeStyled;
